Tuple {
	message : String = 'All arguments of the operation must be specified',
	status : Boolean = if self.messageSort <> MessageSort::reply and not self.sendEvent.oclIsUndefined() and self.sendEvent.oclIsKindOf(MessageOccurrenceSpecification) and not self.signature.oclIsUndefined() then let container : FragmentContainer = self.sendEvent.oclAsType(MessageOccurrenceSpecification).container in if container.fragments->includes(self.sendEvent) then self.signature.parameters->size() = self.arguments->size() and self.signature.parameters->forAll(currentParameter : Parameter | self.arguments->one(argument : ParameterValueMapping | argument.parameter = currentParameter)) else true endif else true endif
}.status

Tuple {
	message : String = 'Return type of signature operation must match the type of assignTo',
	status : Boolean = if not self.assignTo.oclIsUndefined() then let type : Type = if self.assignTo.oclIsTypeOf(Attribute) then self.assignTo.oclAsType(Attribute).type else if self.assignTo.oclIsTypeOf(Reference) then self.assignTo.oclAsType(Reference).type else self.assignTo.oclAsType(AssociationEnd).getType() endif endif in type.oclIsKindOf(self.signature.returnType.oclType()) else true endif
}.status

Tuple {
	message : String = 'Message signature must be an operation of the classifier that is represented by the lifeline of the receive event',
	status : Boolean = if self.messageSort <> MessageSort::reply and not self.receiveEvent.oclIsUndefined() then let typedElement : TypedElement = self.receiveEvent.oclAsType(InteractionFragment).covered->asOrderedSet()->at(1).represents in if not typedElement.oclIsUndefined() then let type : Type = if typedElement.oclIsTypeOf(Parameter) then typedElement.oclAsType(Parameter).type else if typedElement.oclIsTypeOf(Attribute) then typedElement.oclAsType(Attribute).type else if typedElement.oclIsTypeOf(Reference) then typedElement.oclAsType(Reference).type else typedElement.oclAsType(AssociationEnd).getType() endif endif endif in if type.oclIsKindOf(Classifier) then type.oclAsType(Classifier).operations->includes(self.signature) else true endif else true endif else true endif
}.status

Tuple {
	message : String = 'receiveEvent of a self message may not come before the sendEvent',
	status : Boolean = if not self.receiveEvent.oclIsUndefined() and self.receiveEvent.oclIsKindOf(MessageOccurrenceSpecification) and not self.sendEvent.oclIsUndefined() and self.sendEvent.oclIsKindOf(MessageOccurrenceSpecification) then let sendEvent : InteractionFragment = self.sendEvent.oclAsType(InteractionFragment) in let receiveEvent : InteractionFragment = self.receiveEvent.oclAsType(InteractionFragment) in if sendEvent.covered->asOrderedSet()->at(1) = receiveEvent.covered->asOrderedSet()->at(1) then sendEvent.container.fragments->indexOf(self.sendEvent) < receiveEvent.container.fragments->indexOf(self.receiveEvent) else true endif else true endif
}.status

Tuple {
	message : String = 'Reply message must have returns specified if return type is not void',
	status : Boolean = if self.messageSort = MessageSort::reply then if not self.signature.returnType.oclIsTypeOf(RVoid) then not self.returns.oclIsUndefined() else self.returns.oclIsUndefined() endif else true endif
}.status

Tuple {
	message : String = 'Type of return value must match the type of the return',
	status : Boolean = if self.returns.oclIsTypeOf(StructuralFeatureValue) then let value : StructuralFeatureValue = self.returns.oclAsType(StructuralFeatureValue).value in if not value.oclIsUndefined() then let type : Type = if value.oclIsTypeOf(Attribute) then value.oclAsType(Attribute).type else if value.oclIsTypeOf(Reference) then value.oclAsType(Reference).type else value.oclAsType(AssociationEnd).getType() endif endif in type.oclIsTypeOf(self.signature.returnType.oclType()) else true endif else if self.returns.oclIsKindOf(LiteralSpecification) then false else true endif endif
}.status

Tuple {
	message : String = 'Messages may not cross boundaries of CombinedFragments or their operands',
	status : Boolean = let send : MessageOccurrenceSpecification = self.sendEvent in let receive : MessageOccurrenceSpecification = self.receiveEvent in if send.container.oclIsTypeOf(InteractionOperand) and receive.container.oclIsTypeOf(InteractionOperand) then send.container.oclAsType(InteractionOperand).CombinedFragment.covered->includes(send.covered->asOrderedSet()->at(1)) and receive.container.oclAsType(InteractionOperand).CombinedFragment.covered->includes(receive.covered->asOrderedSet()->at(1)) else true endif
}.status

Tuple {
	message : String = 'The destruction occurrence may not come before any other occurrence on this lifeline',
	status : Boolean = if self.messageSort = MessageSort::deleteMessage then if not self.receiveEvent.oclIsUndefined() and not self.receiveEvent.oclAsType(InteractionFragment).covered->isEmpty() then let event : InteractionFragment = self.receiveEvent.oclAsType(InteractionFragment) in event.covered->asOrderedSet()->at(1).coveredBy->forAll(fragment : InteractionFragment | if event.container.fragments->includes(fragment) then event.container.fragments->indexOf(fragment) <= event.container.fragments->indexOf(event) else true endif) else true endif else true endif
}.status

Tuple {
	message : String = 'The create message occurrence may not come after any other occurrence on this lifeline',
	status : Boolean = if self.messageSort = MessageSort::createMessage then if not self.receiveEvent.oclIsUndefined() and not self.receiveEvent.oclAsType(InteractionFragment).covered->isEmpty() then let event : InteractionFragment = self.receiveEvent.oclAsType(InteractionFragment) in event.covered->asOrderedSet()->at(1).coveredBy->forAll(fragment : InteractionFragment | if event.container.fragments->includes(fragment) then event.container.fragments->indexOf(fragment) >= event.container.fragments->indexOf(event) else true endif) else true endif else true endif
}.status

Tuple {
	message : String = 'Returns may only be specified if message sort is reply message',
	status : Boolean = if not self.returns.oclIsUndefined() then self.messageSort = MessageSort::reply else true endif
}.status

Tuple {
	message : String = 'assignTo may not be specified for operations whose return type is void',
	status : Boolean = if self.signature.returnType.oclIsTypeOf(RVoid) then self.assignTo = null else true endif
}.status

Tuple {
	message : String = 'Messages may not cross each other, MessageEnds of one message must come one after the other (also, send must come before receive)',
	status : Boolean = if not self.receiveEvent.oclIsUndefined() and self.receiveEvent.oclIsKindOf(MessageOccurrenceSpecification) and not self.sendEvent.oclIsUndefined() and self.sendEvent.oclIsKindOf(MessageOccurrenceSpecification) then let container : FragmentContainer = self.receiveEvent.oclAsType(MessageOccurrenceSpecification).container in let indexDifference : Integer = container.fragments->indexOf(self.receiveEvent) - container.fragments->indexOf(self.sendEvent) in indexDifference = 1 else true endif
}.status

Tuple {
	message : String = 'opt and loop fragments may only have one operand',
	status : Boolean = if self.interactionOperator = InteractionOperatorKind::opt or self.interactionOperator = InteractionOperatorKind::loop or self.interactionOperator = InteractionOperatorKind::critical then self.operands->size() = 1 else true endif
}.status

Tuple {
	message : String = 'Type of value must match the type of the parameter',
	status : Boolean = if self.value.oclIsTypeOf(StructuralFeatureValue) then let value : StructuralFeatureValue = self.value.oclAsType(StructuralFeatureValue).value in if not value.oclIsUndefined() then let type : Type = if value.oclIsTypeOf(Attribute) then value.oclAsType(Attribute).type else if value.oclIsTypeOf(Reference) then value.oclAsType(Reference).type else value.oclAsType(AssociationEnd).getType() endif endif in type.oclIsTypeOf(self.parameter.type.oclType()) else true endif else if self.value.oclIsKindOf(LiteralSpecification) then false else true endif endif
}.status

Tuple {
	message : String = 'The type of the parameter may not be void',
	status : Boolean = not self.type.oclIsTypeOf(RVoid)
}.status

Tuple {
	message : String = 'Aspect may not depend on itself',
	status : Boolean = not (self.externalAspect = self.Aspect)
}.status

Tuple {
	message : String = 'Partial elements from lower-level aspects have to be mapped',
	status : Boolean = if self.type = InstantiationType::Depends then self.externalAspect.mandatoryAspectParameters->forAll(element : MappableElement | self.mappings->exists(fromElement = element)) else true endif
}.status

Tuple {
	message : String = 'Type of value must match the type of the parameter',
	status : Boolean = self.parameter.type.oclIsTypeOf(self.ParameterValueMapping.parameter.type.oclType())
}.status

Tuple {
	message : String = 'InteractionFragment may only have one Lifeline it covers (except CombinedFragment)',
	status : Boolean = if not self.oclIsTypeOf(CombinedFragment) and covered->notEmpty() then covered->size() = 1 else true endif
}.status

Tuple {
	message : String = 'An empty MessageView must have at least one affectedBy',
	status : Boolean = if self.specification.oclIsUndefined() and self.specifies.partial then self.affectedBy->notEmpty() else true endif
}.status

Tuple {
	message : String = 'The first message in the MessageView must match specifies of the MessageView',
	status : Boolean = if not self.specification.oclIsUndefined() and self.specification.messages->size() > 0 then self.specifies = self.specification.messages->select(message : Message | not message.sendEvent.oclIsTypeOf(MessageOccurrenceSpecification))->asOrderedSet()->at(1).signature else true endif
}.status

Tuple {
	message : String = 'A MessageView for a non-partial operation must have a specification',
	status : Boolean = if not self.specifies.oclIsUndefined() then if not self.specifies.partial then not self.specification.oclIsUndefined() else true endif else true endif
}.status

Tuple {
	message : String = 'Name of RAM elements may not be empty',
	status : Boolean = if self.oclIsTypeOf(AssociationEnd) and self.oclAsType(AssociationEnd).navigable = false then true else self.name <> '' endif
}.status

Tuple {
	message : String = 'A class may not be it\'s own supertype',
	status : Boolean = not self.superTypes->includes(self)
}.status

Tuple {
	message : String = 'Message View may not be affected by itself',
	status : Boolean = not self.affectedBy->includes(self)
}.status

Tuple {
	message : String = 'AssociationEnds of a class must be unique',
	status : Boolean = self.myClass.associationEnds->select(associationEnd : AssociationEnd | associationEnd.name <> null and associationEnd.name <> '')->isUnique(name)
}.status

Tuple {
	message : String = 'MessageView missing for public operation',
	status : Boolean = if visibility = Visibility::public and self.Classifier.oclIsTypeOf(Class) then self.Classifier.oclContainer().oclAsType(StructuralView).Aspect.messageViews->select(messageView : AbstractMessageView | messageView.oclIsTypeOf(MessageView))->one(messageView : AbstractMessageView | messageView.oclAsType(MessageView).specifies = self) else true endif
}.status

Tuple {
	message : String = 'The lowerbound must be greater than or equal to zero',
	status : Boolean = self.lowerBound >= 0
}.status

Tuple {
	message : String = 'The lowerBound must be less than or equal to the upperBound',
	status : Boolean = self.lowerBound <= self.upperBound or self.upperBound = -1
}.status

Tuple {
	message : String = 'The upperbound must be greater than zero or -1 representing *',
	status : Boolean = self.upperBound > 0 or self.upperBound = -1
}.status

Tuple {
	message : String = 'There may be only one type of the same type',
	status : Boolean = self.types->isUnique(name)
}.status

Tuple {
	message : String = 'Name of a class has to be unique',
	status : Boolean = self.classes->isUnique(name)
}.status

Tuple {
	message : String = 'The MessageViewReference must have at least one affectedBy',
	status : Boolean = self.affectedBy->size() > 0
}.status
